import React from 'react';

export function ProfileContainer({ fluid, children }) {
    return <div className={`container${fluid ? "-fluid" : ""}`}
    style={{paddingTop: 20, position: 'fixed', paddingBottom: 20, backgroundColor: "white", height: "600px", width: "1000px", alignContent: 'center', left: '10%'}}>{children}</div>
}
